import React from 'react';
import ReactDOM from 'react-dom';
import Stack from '@mui/material/Stack';
import Button from '@mui/material/Button';
import Dialog from '@mui/material/Dialog';
import DialogActions from '@mui/material/DialogActions';
import DialogContent from '@mui/material/DialogContent';
import DialogContentText from '@mui/material/DialogContentText';
import DialogTitle from '@mui/material/DialogTitle';
import useMediaQuery from '@mui/material/useMediaQuery';
import { useTheme } from '@mui/material/styles';
import { IconButton } from '@mui/material';
import CloseIcon from '@mui/material/Icon'

export default function OpenTutorWindow() {
    const [open, setOpen] = React.useState(false);
    const theme = useTheme();
    const fullScreen = useMediaQuery(theme.breakpoints.down("md"));
    return <Dialog 
        fullScreen={fullScreen} 
        open={open}
        onClose={setOpen(false)}
        aria-labelledby="Tutor Window">
      <DialogTitle id="Tutor Window">{"Pick your tutor for this class"}</DialogTitle>
      <DialogContent>
        <DialogContentText>
          If you're seeing this, that means that the dialog box is working.
        </DialogContentText>
      </DialogContent>
      <DialogActions>
        <IconButton aria-label="close"><CloseIcon /></IconButton>
      </DialogActions>
      </Dialog>;
  }
